def greedyDelivery(G): #O(n d(v))
    res = []
    circuito = []
    n = len(G)
    porcentaje = 30
    #este index podria ahorrarmelo armando la lista de numeros hasta len de G para saber cantidad de indexes
    #aunque no llegue a hacer el cambio para la complejidad voy a contarlo como O(1)
    allIndexes = [G.index(x) for x in G]
    i = random.choice(allIndexes) #selecciona random de donde arrancar
    visitados = [i]
    sortedG = [sorted(x)[1:] for x in G] #eliminamos el 0 que es la identidad de la matriz mientras sorteamos min
    splitList = math.ceil(porcentaje * len(sortedG[0]) / 100)
    while len(visitados) < n: #O(n)
        current = sortedG[i]
        indexRepetidosStart = 0
        repetidos = 1
        filtrados = []
        #filtramos por los no visitamos y se agrego logica por si hay valores repetidos para que agarre el index correcto
        for x in current: # O(d(v))
            #podria ahorrarme estos index quizas armando un diccionario donde mapee cada indice a su valor para despues accederlo en O(1)
            #aunque no llegue a hacer el cambio para la complejidad voy a contarlo como O(1)
            if G[i].index(x, indexRepetidosStart) not in visitados: #O(1)
                filtrados.append([x,G[i].index(x, indexRepetidosStart)])
            if x in current[current.index(x) + repetidos:]:
                indexRepetidosStart = G[i].index(x, indexRepetidosStart) + 1
                repetidos += 1
            else:
                indexRepetidosStart = 0
                repetidos = 1
        #nos quedamos con un top 30% y selecciona random
        selected = random.choice(filtrados[:splitList]) #creo que es O(1) choice
        indexSelected = selected[1]
        circuito.append([visitados[-1], indexSelected]) #O(1)
        visitados.append(indexSelected) #O(1)
        res.append(selected[0]) #O(1)
        i = indexSelected
    current = G[visitados[-1]]
    selected = current[visitados[0]]
    indexSelected = G[i].index(selected) #O(n)
    res.append(selected) #O(1)
    circuito.append([visitados[-1], indexSelected]) #O(1)
    visitados.append(indexSelected) #O(1)
    return res, circuito

def deSwapVecinos(G, copyCircuito, copyCostoCircuito, indexAnterior, indexInCircuito, indexPosterior):#O(1)
    #deshacer swap
    aristaAnterior = copyCircuito[indexAnterior]
    aristaPosterior = copyCircuito[indexPosterior]
    copyCircuito[indexInCircuito][1], copyCircuito[indexInCircuito][0] = copyCircuito[indexInCircuito][0], copyCircuito[indexInCircuito][1]
    nodoIzq = aristaAnterior.pop(1) # O(1)
    nodoDer = aristaPosterior.pop(0) # O(1)
    aristaAnterior.append(nodoDer) # O(1)
    aristaPosterior.insert(0, nodoIzq) # O(1)
    copyCostoCircuito[indexAnterior] = G[aristaAnterior[0]][aristaAnterior[1]]
    copyCostoCircuito[indexPosterior] = G[aristaPosterior[0]][aristaPosterior[1]]
    return None

def swapVecinos(G, copyCircuito, copyCostoCircuito, costoOriginal, indexAnterior, indexInCircuito, indexPosterior):#O(1)
    #swapeamos arista del circuito copiado
    aristaAnterior = copyCircuito[indexAnterior]
    aristaPosterior = copyCircuito[indexPosterior]
    nodoIzq = aristaAnterior.pop(1) # O(1)
    nodoDer = aristaPosterior.pop(0) # O(1)
    aristaAnterior.append(nodoDer) # O(1)
    aristaPosterior.insert(0, nodoIzq) # O(1)
    copyCircuito[indexInCircuito][0], copyCircuito[indexInCircuito][1] = copyCircuito[indexInCircuito][1], copyCircuito[indexInCircuito][0] #no tiene sentido en costo del circuito pero cambio lugar para que sea mas facil leer
    #hacemos costos mirando el original del mapa restandole los costos que cambiamos del swap y sumarle los nuevos del swap
    copyValorPreRestaAnterior = copyCostoCircuito[indexAnterior]
    copyValorPreRestaPosterior = copyCostoCircuito[indexPosterior]
    copyCostoCircuito[indexAnterior] = G[aristaAnterior[0]][aristaAnterior[1]]
    copyCostoCircuito[indexPosterior] = G[aristaPosterior[0]][aristaPosterior[1]]
    costoSinAristas = costoOriginal - copyValorPreRestaAnterior - copyValorPreRestaPosterior
    costoSinAristas += G[aristaAnterior[0]][aristaAnterior[1]] + G[aristaPosterior[0]][aristaPosterior[1]]
    return copyCircuito, copyCostoCircuito, costoSinAristas

def buscarMVecinos(G, costoCircuito, circuito): # O(n)
    sumOriginal = sum(costoCircuito)
    #dejo en 0 el original y en 1 se va a guardar el minimo
    res = {0: [circuito, [costoCircuito, sumOriginal]], 1: [[], sumOriginal]}
    for arista in circuito: #recorre n
        copyCircuito = res[0][0]
        copyCostoCircuito = res[0][1][0]
        #este index podria ahorrarmelo con un contador para saber que index es la arista
        #aunque no llegue a hacer el cambio para la complejidad voy a contarlo como O(1)
        indexInCircuito = circuito.index(arista) #O(1)
        indexAnterior = indexInCircuito - 1
        indexPosterior = indexInCircuito + 1
        if len(circuito) == indexInCircuito + 1: 
            indexPosterior = 0
        copyCircuito, copyCostoCircuito, costoSinAristas = swapVecinos(G, res[0][0], res[0][1][0], res.get(0)[1][1], indexAnterior, indexInCircuito, indexPosterior)
        if res.get(1)[1] > costoSinAristas:
            res[1] = [[indexAnterior, indexInCircuito, indexPosterior], costoSinAristas]
        deSwapVecinos(G, copyCircuito, copyCostoCircuito, indexAnterior, indexInCircuito, indexPosterior)
    return res[1][1], res[1][0]

def busquedaLocales(G):# supongo peor seria #O(n^2)
    porcentaje = 20
    maxIntentos = math.ceil(porcentaje * len(G[0]) / 100)
    costoG, circuitoG = greedyDelivery(G) # #O(n d(v))
    porcentajaMejora = 30
    costoOriginal = sum(costoG) # O(n)
    diferencia = costoOriginal - costoOriginal
    calculo = (100 * diferencia) / costoOriginal
    while calculo < porcentajaMejora and maxIntentos > 0: #peor caso podria llegar a ser 100% y seria recorrer n
        costoN, indexesToSwap = buscarMVecinos(G, costoG, circuitoG) # O(n)
        if indexesToSwap == []:
            circuitoN = circuitoG
            costoCircuitoN = costoG
            maxIntentos = 0
        else:
            copyCircuito, copyCostoCircuito, costoSinAristas = swapVecinos(G, circuitoG, costoG, costoOriginal, indexesToSwap[0], indexesToSwap[1], indexesToSwap[2])
            circuitoN = copy.deepcopy(copyCircuito)
            costoCircuitoN = copy.deepcopy(copyCostoCircuito)
            deSwapVecinos(G, copyCircuito, copyCostoCircuito, indexesToSwap[0], indexesToSwap[1], indexesToSwap[2])
            maxIntentos -= 1
        diferencia = costoOriginal - costoN
        calculo = (100 * diferencia) / costoOriginal
        costoG = costoCircuitoN
        circuitoG = circuitoN
    return costoG, circuitoG

def grasp(G): #O(n^3)
    porcentaje = 30
    maxIntentos = math.ceil(porcentaje * len(G[0]) / 100)
    costoG = None
    circuitoG = None
    while maxIntentos > 0: #peor caso podria terminar siendo recorrer n
        costoN, circuitoN = busquedaLocales(G) #O(n^2)
        costoNuevo = sum(costoN)
        if costoG == None or costoNuevo < costoG:
            costoG = costoNuevo
            circuitoG = circuitoN
        maxIntentos -= 1
    return costoG, circuitoG

grasp(G1402)